import React from 'react';
import { Jumbotron } from 'react-bootstrap';

const Jumbo = () => {
    return (
        <Jumbotron>
            <h1>Welcome to your Employee Directory!</h1>

            <hr/>

            <p>Select from the list on the right what you would like to do.</p>


        </Jumbotron>
    )
}

export default Jumbo
